import React from 'react';
import './App.css';

function BoxHead(props){
  const headItems = props.head.map((item)=><th>{item}</th>);
  return (<tr>{headItems}</tr>);
}

function BoxRow(props){
  const items = props.row.map(
    (item)=>
      <tr>
       <td>{item.num}</td>
       <td>{item.name}</td>
       <td>{item.person}</td>
       <td>{item.type}</td>
       <td>{item.other}</td>
      </tr>
  );
  return items 
}

function ListLink(props){
  const item = props.items;
  return (<li><a href={item.link}>{item.name}</a></li>);
}

function App() {
  links = {link:"https://www.github.com/mrcrnkovich", name:"GitHub"};
  const HeaderLinks = <ListLink items={links} />;
  return (
    <div className="App">
      <h3><ul>{HeaderLinks}</ul></h3>
      <h1>Michael Crnkovich</h1>
      <h3>About</h3>
    </div>
  );
}

export default App;
